function escapeHTML(str, jsContext) {
	const string = new Option(str).innerHTML;
	if (jsContext) {
		string.replace(/"/g, '"').replace(/'/g, "'").replace(/\n/g, "\\n").replace(/\/r/g, "\\r")
	} else {
		string.replace(/"/g, "&quot;")
	}
	return string
}

